metadata:
  id: "json-string-to-object-converter"
  inputs:
    - name: "jsonString"
      type: "string"
  outputs:
    - name: "result"
      type: "object"
  completionType: "explicit"
  reactiveInputs: []

function jsonToStringConverter(inputs, outputs) {
  const { jsonString } = inputs;
  const { result } = outputs;

  try {
    const parsedObject = JSON.parse(jsonString);
    result.setValue(parsedObject);
    result.setCompleted();
  } catch (error) {
    result.setError(error);
  }
}
